import './App.css';
import {
  BrowserRouter as Router,
  Switch,
  Route,
} from "react-router-dom";
import {MainPage} from './pages/MainPage'
import {FilmPage} from './pages/FilmPage'


function App() {
  return (
    <div className="App">
      <Router>        
       <MainPage/>  

          <Route path='/' element={<MainPage/>}></Route>
          <Route path='film/:id' element={<FilmPage/>}></Route>

      </Router>
    </div>
  );
}

export default App;
